import React from "react";
import { Route } from "react-router-dom";
import { routes } from "./routes";

const AppRouter = () => {
  return (
    <>
      {routes.map((route) => (
        <Route key={route.key} path={route.path} element={route.element} />
      ))}
    </>
  );
};

export default AppRouter;
